/*Table structure for table `applicant_appliedjob` */

DROP TABLE IF EXISTS `applicant_appliedjob`;

CREATE TABLE `applicant_appliedjob` (
  `applied_id` int(11) NOT NULL AUTO_INCREMENT,
  `app_id` int(11) NOT NULL,
  `job_id` int(11) NOT NULL,
  `essay_id` int(11) NOT NULL,
  PRIMARY KEY (`applied_id`),
  KEY `app_id` (`app_id`,`job_id`),
  KEY `job_id` (`job_id`),
  KEY `essay_id` (`essay_id`),
  CONSTRAINT `applicant_appliedjob_ibfk_1` FOREIGN KEY (`app_id`) REFERENCES `applicantinfo` (`app_id`),
  CONSTRAINT `applicant_appliedjob_ibfk_2` FOREIGN KEY (`job_id`) REFERENCES `jobs` (`job_id`),
  CONSTRAINT `applicant_appliedjob_ibfk_3` FOREIGN KEY (`essay_id`) REFERENCES `applicant_essay` (`essay_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;

/*Data for the table `applicant_appliedjob` */

insert  into `applicant_appliedjob`(`applied_id`,`app_id`,`job_id`,`essay_id`) values (1,1,1,10),(2,2,1,14),(3,11,1,18),(4,3,1,22),(5,4,1,29),(6,13,1,30),(7,6,1,37);

/*Table structure for table `applicant_essay` */

DROP TABLE IF EXISTS `applicant_essay`;

CREATE TABLE `applicant_essay` (
  `essay_id` int(11) NOT NULL AUTO_INCREMENT,
  `app_id` int(11) NOT NULL,
  `question_id` int(11) NOT NULL,
  `answer` text,
  `started` datetime NOT NULL,
  `ended` datetime NOT NULL,
  PRIMARY KEY (`essay_id`),
  KEY `essay_id` (`essay_id`,`app_id`,`question_id`),
  KEY `app_id` (`app_id`),
  CONSTRAINT `applicant_essay_ibfk_1` FOREIGN KEY (`app_id`) REFERENCES `applicantinfo` (`app_id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=latin1;

/*Data for the table `applicant_essay` */

insert  into `applicant_essay`(`essay_id`,`app_id`,`question_id`,`answer`,`started`,`ended`) values (1,2,261,'A. ACTIVITIES LAST OCT 23-27\r\n1. An emergency meeting was called by CBC last October 24 regarding pre-implementation issues. Attendees included Ms. Jeck Maog and Ms. Editha Young. Agenda discussed were the timeline, work-around with the dependency on hardware delivery, and DB2 support.\r\n2. A two-part Knowledge Transfer on BigFix Orientation was done last October 26 and 27.\r\n3. A site visit was done last October 26 c/o SE Joester Geroy. Changes on the Configuration Plan was raised: instead of using RAID5, CBC will use RAID10.\r\n\r\nB. DB2 SUPPORT\r\n1. This week was dedicated to resolving the DB2 post-implementation support requested by CBC. Buddy del Rosario has agreed on providing post-implementation DB2 support and CBC has also verbally agreed on purchasing the support with additional costs.\r\n2. We\'re currently working out the details of the support and drafting a proposal to send to CBC.\r\n\r\nC. HARDWARE DELIVERY ETA\r\n1. Hardware delivery ETA has reached the 30-day mark last November 2.\r\n2. MSI has given an update that the materials have been shipped last October 30 (Monday). They\'re currently waiting on the flight details so they can send a delivery ETA.','2017-11-07 10:37:18','2017-11-07 10:38:43'),(2,2,262,'A. ACTIVITIES LAST OCT 23-27\r\n1. An emergency meeting was called by CBC last October 24 regarding pre-implementation issues. Attendees included Ms. Jeck Maog and Ms. Editha Young. Agenda discussed were the timeline, work-around with the dependency on hardware delivery, and DB2 support.\r\n2. A two-part Knowledge Transfer on BigFix Orientation was done last October 26 and 27.\r\n3. A site visit was done last October 26 c/o SE Joester Geroy. Changes on the Configuration Plan was raised: instead of using RAID5, CBC will use RAID10.\r\n\r\nB. DB2 SUPPORT\r\n1. This week was dedicated to resolving the DB2 post-implementation support requested by CBC. Buddy del Rosario has agreed on providing post-implementation DB2 support and CBC has also verbally agreed on purchasing the support with additional costs.\r\n2. We\'re currently working out the details of the support and drafting a proposal to send to CBC.\r\n\r\nC. HARDWARE DELIVERY ETA\r\n1. Hardware delivery ETA has reached the 30-day mark last November 2.\r\n2. MSI has given an update that the materials have been shipped last October 30 (Monday). They\'re currently waiting on the flight details so they can send a delivery ETA.','2017-11-07 10:37:18','2017-11-07 10:38:43'),(3,2,263,'A. ACTIVITIES LAST OCT 23-27\r\n1. An emergency meeting was called by CBC last October 24 regarding pre-implementation issues. Attendees included Ms. Jeck Maog and Ms. Editha Young. Agenda discussed were the timeline, work-around with the dependency on hardware delivery, and DB2 support.\r\n2. A two-part Knowledge Transfer on BigFix Orientation was done last October 26 and 27.\r\n3. A site visit was done last October 26 c/o SE Joester Geroy. Changes on the Configuration Plan was raised: instead of using RAID5, CBC will use RAID10.\r\n\r\nB. DB2 SUPPORT\r\n1. This week was dedicated to resolving the DB2 post-implementation support requested by CBC. Buddy del Rosario has agreed on providing post-implementation DB2 support and CBC has also verbally agreed on purchasing the support with additional costs.\r\n2. We\'re currently working out the details of the support and drafting a proposal to send to CBC.\r\n\r\nC. HARDWARE DELIVERY ETA\r\n1. Hardware delivery ETA has reached the 30-day mark last November 2.\r\n2. MSI has given an update that the materials have been shipped last October 30 (Monday). They\'re currently waiting on the flight details so they can send a delivery ETA.','2017-11-07 10:37:18','2017-11-07 10:38:43'),(4,9,261,'testtesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttesttest