nd 27.\r\n3. A site visit was done last October 26 c/o SE Joester Geroy. Changes on the Configuration Plan was raised: instead of using RAID5, CBC will use RAID10.\r\n\r\nB. DB2 SUPPORT\r\n1. This week was dedicated to resolving the DB2 post-implementation support requested by CBC. Buddy del Rosario has agreed on providing post-implementation DB2 support and CBC has also verbally agreed on purchasing the support with additional costs.\r\n2. We\'re currently working out the details of the support and drafting a proposal to send to CBC.\r\n\r\nC. HARDWARE DELIVERY ETA\r\n1. Hardware delivery ETA has reached the 30-day mark last November 2.\r\n2. MSI has given an update that the materials have been shipped last October 30 (Monday). They\'re currently waiting on the flight details so they can send a delivery ETA.','0000-00-00 00:00:00','0000-00-00 00:00:00'),(15,11,261,'Secret. We will be having the QA Level 3 run 1 for Online Recruitment:Online Examination today.\r\n\r\n\r\n\r\nPlease refer to the test scripts that will be given to you.\r\n\r\n\r\n\r\nIf you any concerns/question, feel free to approach me or Sir Jerome anytime. \r\n\r\n\r\n\r\nThank you for your valuable time.\r\n\r\n\r\n\r\nHave a spectacular day ahead!\r\n\r\n','2017-11-07 10:54:13','2017-11-07 10:55:53'),(16,11,262,'Secret We will be having the QA Level 3 run 1 for Online Recruitment:Online Examination today.\r\n\r\n\r\n\r\nPlease refer to the test scripts that will be given to you.\r\n\r\n\r\n\r\nIf you any concerns/question, feel free to approach me or Sir Jerome anytime. \r\n\r\n\r\n\r\nThank you for your valuable time.\r\n\r\n\r\n\r\nHave a spectacular day ahead!\r\n\r\n','2017-11-07 10:54:13','2017-11-07 10:55:53'),(17,11,263,'Secret. We will be having the QA Level 3 run 1 for Online Recruitment:Online Examination today.\r\n\r\n\r\n\r\nPlease refer to the test scripts that will be given to you.\r\n\r\n\r\n\r\nIf you any concerns/question, feel free to approach me or Sir Jerome anytime. \r\n\r\n